import React from 'react';
import { StyleSheet, View } from 'react-native';
import Button from '../components/Button';
import Background from '../components/Background';
import { Text } from 'react-native-paper';

export default function RedoQuestionsScreen({ navigation, route }) {
    const { incorrectIndices } = route.params;

    const handleContinue = () => {
        navigation.navigate('QuizScreen', { redoIncorrect: true, incorrectIndices: incorrectIndices });
    };

    return (
        <Background>
            <View style={styles.container}>
                <Text style={styles.text}>
                    Now let's revisit the questions that you didn't get right on the first go.
                </Text>

                <Button
                    color="black"
                    mode="contained"
                    onPress={handleContinue}
                >
                    Continue
                </Button>
            </View>
        </Background>
    );
}

const styles = StyleSheet.create({
    container: {
        flex: 1,
        justifyContent: 'center',
        alignItems: 'center',
    },
    text: {
        fontSize: 24,
        fontWeight: 'bold',
        marginBottom: 20,
        textAlign: 'center',
    },
});
